BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "teacherhire_classcategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "teacherhire_educationalqualification" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NULL UNIQUE, "description" text NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_reason" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "issue_type" varchar(200) NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "teacherhire_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "jobrole_name" varchar(400) NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_skill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NULL UNIQUE, "description" text NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_teacherjobtype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "teacher_job_name" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_customuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "username" varchar(150) NOT NULL UNIQUE, "Fname" varchar(100) NULL, "Lname" varchar(100) NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "is_recruiter" bool NOT NULL, "is_teacher" bool NOT NULL, "is_centeruser" bool NOT NULL, "is_questionuser" bool NOT NULL, "is_verified" bool NOT NULL, "otp" varchar(8) NULL, "otp_created_at" datetime NULL, "date" datetime NOT NULL, "user_code" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_customuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_customuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_basicprofile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "bio" text NULL, "profile_picture" varchar(100) NULL, "phone_number" varchar(15) NULL UNIQUE, "religion" varchar(100) NULL, "date_of_birth" date NULL, "marital_status" varchar(20) NULL, "gender" varchar(10) NULL, "language" varchar(100) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" bigint NULL UNIQUE REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_apply" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" bool NOT NULL, "date" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_apply_class_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "apply_id" bigint NOT NULL REFERENCES "teacherhire_apply" ("id") DEFERRABLE INITIALLY DEFERRED, "classcategory_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_examcenter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "center_name" varchar(200) NULL, "pincode" varchar(6) NULL, "state" varchar(100) NULL, "city" varchar(100) NULL, "area" text NULL, "status" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_passkey" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(200) NULL UNIQUE, "status" varchar(200) NOT NULL, "reject_reason" varchar(500) NULL, "created_at" datetime NOT NULL, "center_id" bigint NULL REFERENCES "teacherhire_examcenter" ("id") DEFERRABLE INITIALLY DEFERRED, "exam_id" bigint NULL REFERENCES "teacherhire_exam" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_subject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject_name" varchar(100) NULL, "subject_description" text NULL, "class_category_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_recruiterenquiryform" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "teachertype" varchar(200) NULL, "pincode" varchar(6) NULL, "state" varchar(100) NULL, "city" varchar(100) NULL, "area" text NULL, "name" varchar(200) NULL, "email" varchar(254) NOT NULL, "contact" integer unsigned NULL CHECK ("contact" >= 0));
CREATE TABLE IF NOT EXISTS "teacherhire_recruiterenquiryform_subject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "recruiterenquiryform_id" bigint NOT NULL REFERENCES "teacherhire_recruiterenquiryform" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_assignedquestionuser_subject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "assignedquestionuser_id" bigint NOT NULL REFERENCES "teacherhire_assignedquestionuser" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_apply_subject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "apply_id" bigint NOT NULL REFERENCES "teacherhire_apply" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_teacherclasscategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "class_category_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_teacherexperiences" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "institution" varchar(255) NULL, "start_date" date NULL, "end_date" date NULL, "description" text NULL, "achievements" text NULL, "role_id" bigint NULL REFERENCES "teacherhire_role" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_preference" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_preference_class_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "preference_id" bigint NOT NULL REFERENCES "teacherhire_preference" ("id") DEFERRABLE INITIALLY DEFERRED, "classcategory_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_preference_job_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "preference_id" bigint NOT NULL REFERENCES "teacherhire_preference" ("id") DEFERRABLE INITIALLY DEFERRED, "role_id" bigint NOT NULL REFERENCES "teacherhire_role" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_preference_prefered_subject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "preference_id" bigint NOT NULL REFERENCES "teacherhire_preference" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_preference_teacher_job_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "preference_id" bigint NOT NULL REFERENCES "teacherhire_preference" ("id") DEFERRABLE INITIALLY DEFERRED, "teacherjobtype_id" bigint NOT NULL REFERENCES "teacherhire_teacherjobtype" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_hirerequest" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" datetime NOT NULL, "status" varchar(200) NOT NULL, "reject_reason" varchar(500) NULL, "recruiter_id_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "teacher_id_id" bigint NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_hirerequest_subject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "hirerequest_id" bigint NOT NULL REFERENCES "teacherhire_hirerequest" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_hirerequest_teacher_job_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "hirerequest_id" bigint NOT NULL REFERENCES "teacherhire_hirerequest" ("id") DEFERRABLE INITIALLY DEFERRED, "teacherjobtype_id" bigint NOT NULL REFERENCES "teacherhire_teacherjobtype" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_apply_teacher_job_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "apply_id" bigint NOT NULL REFERENCES "teacherhire_apply" ("id") DEFERRABLE INITIALLY DEFERRED, "teacherjobtype_id" bigint NOT NULL REFERENCES "teacherhire_teacherjobtype" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_teacherqualification" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "institution" varchar(225) NULL, "year_of_passing" integer unsigned NULL CHECK ("year_of_passing" >= 0), "grade_or_percentage" varchar(50) NULL, "qualification_id" bigint NULL REFERENCES "teacherhire_educationalqualification" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "subjects" text NULL CHECK ((JSON_VALID("subjects") OR "subjects" IS NULL)));
CREATE TABLE IF NOT EXISTS "teacherhire_teachersaddress" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "address_type" varchar(10) NULL, "state" varchar(100) NULL, "division" varchar(100) NULL, "postoffice" varchar(100) NULL, "district" varchar(100) NULL, "block" varchar(100) NULL, "village" varchar(100) NULL, "area" text NULL, "pincode" varchar(6) NULL, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_teacherskill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "skill_id" bigint NOT NULL REFERENCES "teacherhire_skill" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_teachersubject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_report_issue_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "report_id" bigint NOT NULL REFERENCES "teacherhire_report" ("id") DEFERRABLE INITIALLY DEFERRED, "reason_id" bigint NOT NULL REFERENCES "teacherhire_reason" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_jobpreferencelocation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "state" varchar(200) NULL, "city" varchar(200) NULL, "sub_division" varchar(200) NULL, "block" varchar(200) NULL, "post_office" varchar(200) NULL, "area" text NULL, "pincode" varchar(6) NULL, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_exam" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "description" text NULL, "total_marks" integer unsigned NOT NULL CHECK ("total_marks" >= 0), "duration" integer unsigned NOT NULL CHECK ("duration" >= 0), "type" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "assigneduser_id" bigint NULL REFERENCES "teacherhire_assignedquestionuser" ("id") DEFERRABLE INITIALLY DEFERRED, "class_category_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "level_id" bigint NOT NULL REFERENCES "teacherhire_level" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED, "status" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_assignedquestionuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "status" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_report" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "question_id" bigint NOT NULL REFERENCES "teacherhire_question" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "status" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_assignedquestionuser_class_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "assignedquestionuser_id" bigint NOT NULL REFERENCES "teacherhire_assignedquestionuser" ("id") DEFERRABLE INITIALLY DEFERRED, "classcategory_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_question" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "time" real NOT NULL, "language" varchar(20) NULL, "text" varchar(2000) NOT NULL, "options" text NOT NULL CHECK ((JSON_VALID("options") OR "options" IS NULL)), "correct_option" integer unsigned NOT NULL CHECK ("correct_option" >= 0), "created_at" datetime NOT NULL, "exam_id" bigint NOT NULL REFERENCES "teacherhire_exam" ("id") DEFERRABLE INITIALLY DEFERRED, "solution" text NULL, "related_question_id" bigint NULL REFERENCES "teacherhire_question" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_teacherexamresult" ("examresult_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "correct_answer" integer NULL, "is_unanswered" integer NULL, "incorrect_answer" integer NULL, "isqualified" bool NOT NULL, "created_at" datetime NOT NULL, "has_exam_attempt" bool NOT NULL, "exam_id" bigint NULL REFERENCES "teacherhire_exam" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "language" varchar(20) NOT NULL, "attempt" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "teacherhire_interview" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "time" datetime NULL, "link" varchar(200) NULL, "status" varchar(200) NULL, "grade" real NULL, "created_at" datetime NOT NULL, "class_category_id" bigint NOT NULL REFERENCES "teacherhire_classcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "teacherhire_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "subject_id" bigint NOT NULL REFERENCES "teacherhire_subject" ("id") DEFERRABLE INITIALLY DEFERRED, "reject_reason" varchar(500) NULL, "attempt" integer NOT NULL, "level_id" bigint NULL REFERENCES "teacherhire_level" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacherhire_level" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NULL, "description" varchar(2000) NULL, "level_code" real NULL);
